import React, { Component } from "react";
import ("../pages/style.css");



class Main extends Component {
    render(){
        return(
            <div className="container">
            <div className="lg-picture img1"></div>
<div className="lg-picture img2"></div>
<div className="lg-picture img3"></div>
<div className="lg-picture img4"></div>
<div className="lg-picture img5"></div>
<div className="lg-picture img6"></div>

    <div className="bg-text">Snap It!</div>
            
            </div>
        )
    }
}

export default Main;
